import React from 'react';
import './style/App.css';
import TelaInicial from "./components/TelaInicial";

let rota = 'Login';

function changeRota (value) {
    rota = value
}

function App() {
    return (
        <TelaInicial rota={rota} onCadastrar={event => changeRota('Cadastro') }/>
    );
}

export default App;
